pragma solidity ^0.8.4;

contract EthersWallet {

    address private owner;
    mapping(address => uint) private balances;

    constructor() {
        owner = msg.sender;
    }

    receive() external payable {
        balances[msg.sender] += msg.value; 
    }

    function withdraw(address _address) external {
        
    }
}

